import React from "react";
import "./App.css";
import About from "./About";
import Portfolio from "./Portfolio";
import Nav from "./Nav";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Nav />
      <Router>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/portfolio">
          <Portfolio />
        </Route>
      </Router>
    </div>
  );
}

export default App;
